import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import './css/App.css';
import './css/SearchBar.css';
import './css/Spotify.css';
import { SharedDataProvider } from './components/SharedDataContext'; // Import the context provider
import HomePage from './components/HomePage';
import Login from './components/Login';
import SearchBar from './components/SearchBar';
import TopPlaylists from './components/TopPlaylists';
import NotFoundPage from './components/NotFoundPage'; // Placeholder component for 404 Not Found

function App() {
  return (
    <SharedDataProvider> {/* Wrap the application with SharedDataProvider */}
      <Router>
        <div className="App">
          <ul className="AppHeader">
            <li><Link to="/">HomePage</Link></li>
            <li><Link to="/login">Login</Link></li>
            <li><Link to="/search">SearchBar</Link></li>
            <li><Link to="/top_playlists">TopPlaylists</Link></li>
          </ul>
          <Routes>
            <Route path='/' element={<HomePage />} />
            <Route path='/login' element={<Login />} />
            <Route path="/search" element={<SearchBar />} />
            <Route path="/top_playlists" element={<TopPlaylists />} />
            <Route path='*' element={<NotFoundPage />} />
          </Routes>
          <footer>
            <p>&copy; 2023 Book-Inspired Playlist Generator</p>
          </footer>
        </div>
      </Router>
    </SharedDataProvider>
  );
}

export default App;
